export function song({ Song }) {
    console.log(Song);
    return (<div className="row">
        <div className="col-4">
            <img src={Song.artworkUrl100} />
        </div>
        <div className="col-4">
            {Song.artistName} {Song.trackName}
        </div>

    </div>);
}
